}

.fc .fc-button::-moz-focus-inner {
  padding: 0;
  border-style: none;
}

.fc {
  /* theme */
}

.fc .fc-button {
  display: inline-block;
  font-weight: 400;
  text-align: center;
  vertical-align: middle;
  -webkit-user-select: none;
  -moz-user-select: none;
