<script>
 const carousel = document.getElementById('carousel');

  function isFirstCard() {
    return carousel.scrollLeft === 0;
  }

  function isLastCard() {
    return carousel.scrollLeft + carousel.clientWidth >= carousel.scrollWidth;
  }

  function previousCard() {
    carousel.scrollTo({
      left: carousel.scrollLeft - carousel.clientWidth,
      behavior: 'smooth',
    });
  }

  function nextCard() {
    carousel.scrollTo({
      left: carousel.scrollLeft + carousel.clientWidth,
      behavior: 'smooth',
    });
  }

  function navigateToCard(id)
 {
    const card = document.getElementById(id)
;
    if (card) {
      card.scrollIntoView({
        behavior: 'smooth',
        block: 'center',
        inline: 'nearest',
      });
    }
  }

  let currentIndexHead = 0;
  const slides = document.querySelectorAll('.slides');
  let intervalId;

  function showSlide(index) {
    slides.forEach((slide, i) => {
      slide.style.display = (i === index) ? 'block' : 'none';
    });
  }

  function startSlideshow() {
    intervalId = setInterval(() => {
      currentIndexHead = (currentIndexHead + 1) % slides.length;
      showSlide(currentIndexHead);
    }, 5000); // Change image every 5 seconds
  }

  function stopSlideshow() {
    clearInterval(intervalId);
  }

  // Initialize slideshow
  document.addEventListener('DOMContentLoaded', () => {
    showSlide(currentIndexHead);
    startSlideshow();
  });

  // Stop slideshow when the page is unloaded
  window.addEventListener('beforeunload', () => {
    stopSlideshow();
  });
</script>
